import '../styles/App.scss';
import data from '../data/clubs.json';

function App() {
  console.log(data);
  const renderClubs = data.map((oneClub, index) => (
    <li key={index}>
      <h3>
        {`# ${index} `}
        {oneClub.name}
      </h3>
      <p>
        Abierto entre semana:{oneClub.openOnWeekdays === true ? 'Sí' : 'No'}
      </p>
      <p>
        Abierto el fin de semana:{oneClub.openOnWeekend === true ? 'Sí' : 'No'}
      </p>
    </li>
  ));
  return (
    <div>
      <header>
        <h1>Mis Clubs</h1>
      </header>
      {/*Clubs*/}
      <main>
        <ul>{renderClubs}</ul>
      </main>
      <footer>
        <h3>Añadir un nuevo club</h3>
        <form action="">
          <label htmlFor="name">Nombre del club + ''</label>
          <input
            type="text"
            name="name"
            id="name"
            placeholder="Nombre del Club"
          />
        </form>
      </footer>
    </div>
  );
}

export default App;
